import React from 'react';

function Post({ id, title, content, author, date }) {
  

  return (
    <div>
      <h2>{title}</h2>
      <p>{content}</p>
      <small>By {author} on {date}</small>
      {/* Solo muestra el botón de eliminar si es el autor (esto necesita ajustes reales de autenticación) */}
      {author === "Author Name"}
    </div>
  );
}

export default Post;
